import "./HistoryBanner.css";

const HistoryBanner = () => {
  // Render component
  return (
    <div className="history-banner">
      <div>
        <h3>CART</h3>
      </div>
      <div className="d-none d-sm-block">CART</div>
    </div>
  );
};

export default HistoryBanner;
